var express = require("express");
var app = express();
app.set("view engine","ejs");

var bodyparser=require("body-parser");

app.use(bodyparser.urlencoded({extended: true}));
 
 var camp=[
        {name:"Theni",img:"data:image/jpeg;base64,"},
        {name:"Thanjavur",img:"data:image/jpeg;base64,"},
        {name:"Madurai",img:"data:image/jpeg;base64,"},
        {name:"Theni",img:"data:image/jpeg;base64,"},
        {name:"Thanjavur",img:"data:image/jpeg;base64,"},
        {name:"Madurai",img:"data:image/jpeg;base64,"},
        {name:"Theni",img:"data:image/jpeg;base64,"},
        {name:"Thanjavur",img:"data:image/jpeg;base64,"},
        {name:"Madurai",img:"data:image/jpeg;base64,"},
        {name:"Kodaikanal",img:"data:image/jpeg;base64,"}
        ];
app.get("/",function(req,res){
   res.render("home"); 
});

app.get("/campground",function(req,res){
   
    res.render("campground",{camp:camp});
});

app.post("/campground",function(req,res){
    var name=req.body.name;
        var image=req.body.image;
        camp.push({name:name,img:image});
        res.redirect("/campground");
});

app.get("/campground/new",function(req,res){
   res.render("new"); 
});

app.listen(process.env.PORT,process.env.IP,function(){
   console.log("Yelpcamp server started"); 
});